(1, 'Tentang Kami', 'tentang', 'Tentang Stori', '<div class=\"ui very padded segment\">\r\n\r\n<p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\"><b>Stori</b> adalah platform media love story yang membahas semua hal yang mengenai dunia percintaan mulai dari <b>Gaya Hidup</b>, <b>Hiburan</b>, <b>Blogging</b>, <b>Tips & Trik</b>, <b>PDKT</b>, <b>Pacaran</b>, <b>LDR</b>, hingga ke hubungan <b>Rumah Tangga</b>. Semua opini hanya tersdia di navbar.</span></p>\r\n\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\"><b>Stori</b> diterbitkan sejak tahun 2011, yang sebelumnya menggunakan alamat domain Berpedia.com. Namun dengan seiring berjalannya waktu, kami mencoba berfokus di alamat domain terbaru kami yaitu (<b>Stori.id</b>) hingga sekarang kami masih tetap bertahan untuk merawatnya secara uptodate.</span></p> \r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\"><b>Stori</b> adalah platform media love story Indonesia pertama kali yang menyajikan informasi terbaru dan terlengkap mengenai perjalanan hidup seseorang yang mengalami masalah dunia percintaan dalam hidupnya. Rangkaian konten di dalam <b>Stori</b> dibuat secara profesional, menarik, kreatif dan up-to-date. Dengan kualitas berita love story dari segi desain, editorial dan tulisan terbaik, <b>Stori</b> menjadi berita opini harian yang paling tepat untuk dibaca bagi para penikmat dunia percintaan yang mendambakan lebih dari sekedar informasi.</span></p>\r\n\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kini, selain tetap memberikan konten menarik melalui berita online, kami ingin memberi pengalaman yang berbeda dan lebih menyeluruh melalui website baru kami. Berbekal pengalaman editorial selama lebih dari satu dekade dan didukung oleh tim pengembangan digital, <b>Stori</b> kini menawarkan sebuah konsep baru dimana Anda sebagai pembaca juga bisa sekaligus ikut berkontribusi menciptakan sebuah komunitas Melovers terbesar di Tanah Air Indonesia.</span></p>\r\n\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Selain mendapatkan konten berkualitas dari tim editorial, Anda kini bisa membuat konten sendiri di <b>Stori</b>. Mulai dari artikel tentang gaya hidup, hiburan, tips & trik, percintaan hingga menulis tentang perjalanan hidup Anda yang akan dibaca oleh ribuan pembaca <b>Stori</b> lainnya, kami ingin membuat proses ini sangat sederhana bagi Anda. Website ini akan menjadi wadah bagi para Melovers di Indonesia yang ingin terhubung satu sama lain dan berdiskusi tentang apa yang paling berharga bagi mereka, yaitu <b>Cinta</b>.</span></p>\r\n\r\n\r\n\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Tak bisa dipungkiri, minat masyarakat untuk mengakses informasi kian besar. Seiring dengan itu, dunia digital media juga terus bertumbuh. Menyikapi fenomena tersebut, hadirlah <b>Stori</b>. Apa sih <b>Stori</b> itu? <b>Stori</b> adalah platform yang memungkinkan kita semua menjadi kontributor dan berbagi informasi mulai dari perjalanan tentang hidup, tentang cinta, teman/sahabat, keluarga, suami istri dll. </span></p><p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\"><b>Stori</b> menjadi wadah yang memungkinkan kamu semua memberikan informasi dari beragam aspek, misalnya fiksi, berita cinta, tentang cinta dan lain sebagainya. Lingkup bahasannya pun beraneka, seperti gaya hidup, hiburan, hobi dan apapun yang menjadi ‚Äúpassion‚Äù kamu. Asyiknya, <b>Stori</b> juga mengakomodir kreativitas teman-teman semua untuk mengirimkan materi dalam beragam format, misalnya tulisan, foto, atau bahkan video.</span></p><p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Untuk jangkauan pembaca, <b>Stori</b> yang merupakan bagian dari aplikasi <b>Stori</b> dan sudah diunduh lebih dari 100.00 ribu pengguna, menjamin karyamu dapat dinikmati dan memberi manfaat untuk banyak orang.</span></p><p><b>Logo</b></p><p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\"><b>Stori</b> yang berupa rangkaian warna warni disertai gambar yang unik, memiliki arti semangat ria untuk terus berkreasi dan menciptakan karya secara berkesinambungan. Warna logo tersebut mengandung filosofi bahwa karya yang dibuat akan mampu memberi manfaat bagi banyak orang.</span></p><p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Font atau jenis huruf mengambil dari font reinventing (Nixmat). Jenis huruf ini menggambarkan ketegasan namun tetap memiliki sisi-sisi yang lentur. Secara umum dapat diartikan bahwa setiap orang yang menyumbangkan karyanya di <b>Stori</b> terikat akan kaidah dan aturan-aturan yang berlaku, namun tetap memiliki keleluasaan dalam menuangkan idenya.</span></p>\r\n\r\n</div>', 'Tentang Stori', 1016, 1, 1, 0, 1, '2020-01-13 09:46:41', NULL, '0000-00-00 00:00:00'),
(2, 'Kebijakan Privasi', 'privasi', 'Kebijakan Privasi Stori', '<div class=\"ui very padded segment\">\r\n\r\n<h3 class=\"title color deepgray\" style=\"margin-right: auto; margin-left: auto; color: rgb(100, 99, 99); font-size: 22px; line-height: 30px; margin-top: 10px !important; margin-bottom: 10px !important; font-family: Museo, sans-serif !important; font-weight: 500 !important;\"><span style=\"font-family: Arial;\">Kami Menghargai Privasi Pembaca Kami</span></h3><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Tinjauan</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kami menyadari bahwa privasi di World Wide Web merupakan hal penting bagi Anda. Kami menggunakan informasi untuk memahami kebutuhan Anda dengan lebih baik dan meningkatkan pengalaman Anda pada website kami.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Dalam kebijakan privasi ini, kami menyatakan beberapa praktek yang kami pakai untuk memanfaatkan dan menjelaskan informasi yang diperoleh dari website kami.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Informasi yang kami minta, seperti nama, alamat pengiriman surat dan alamat email akan dipakai untuk memenuhi permintaan Anda atas informasi dan bantuan dalam layanan yang kami berikan. Jika Anda ingin menerima update, kami akan mengirim informasi kepada Anda secara berkala mengenai produk dan layanan Stori lainnya yang kami rasa menarik bagi Anda.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kami tidak menjual atau memberikan informasi yang ada kepada perusahaan lain yang ingin memberitahukan Anda mengenai produk mereka tanpa persetujuan Anda. Selama kebijakan privasi berlaku, kami akan terus memberikan versi terbaru pada website ini.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Pernyataan privasi mencakup website-website yang dioperasikan oleh Stori yang meliputi, tapi tidak terbatas pada, situs-situs domain dan sub domain berikut:</span>&nbsp;<a href=\"https://stori.id/\" style=\"text-decoration: none; -webkit-tap-highlight-color: rgba(255, 255, 255, 0); outline: 0px; color: rgb(206, 10, 70);\">https://stori.id</a></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kebijakan Privasi ini hanya mencakup informasi yang diperoleh melalui website ini dan tidak mencakup informasi yang kemungkinan diperoleh melalui peranti lunak yang diunduh dari situs atau yang diperoleh dari situs-situs lainnya yang ditautkan ke pada situs ini.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Informasi yang Kami Kumpulkan</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kami menyimpan informasi dari pendaftaran, cookies, log files, clear gif dan/atau pihak ketiga untuk menciptakan profil pengguna kami.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Data Pribadi bisa termasuk nama, alamat, nomor telepon, atau alamat e-mail Anda. Kami juga mengumpulkan informasi yang tak dapat diidentifikasi secara pribadi, yang mungkin tertaut pada Data Pribadi Anda, termasuk alamat IP Anda, serta preferensi pencarian terkait pada pencarian spesifik.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kami menggunakan informasi ini untuk menghubungi Anda mengenai layanan di situs kami untuk mengetahui ketertarikan Anda. Umumnya, pengguna memiliki opsi untuk memberikan informasi, identitas unik (seperti, nama pengguna dan kata sandi), tapi untuk mendukungnya kami dapat memberikan pengalaman yang lebih pribadi pada situs kami.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Keamanan</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Stori akan selalu berusaha melindungi informasi pengguna. Ketika pengguna memberikan informasi rahasia via situs Web, informasi mereka dilindungi secara online maupun offline.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Layanan Pelanggan</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kami berhubungan dengan pengguna secara teratur untuk menyajikan layanan yang diperlukan dan mengenai persoalan yang berkaitan dengan akun mereka dan kami membalasnya via email atau telepon, sesuai dengan keinginan pengguna.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Berbagi Data Pribadi Anda</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Ini adalah contoh dimana kami akan membagi informasi pribadi pengguna:</span></p><ul style=\"color: rgb(45, 45, 45); font-family: &quot;Open Sans&quot;; font-size: medium;\"><li style=\"font-size: 15px; line-height: 30px; color: rgb(110, 109, 109);\"><span style=\"font-family: Arial;\">Stori dapat membagikan Data Pribadi Anda dengan pihak ketiga yang kami pekerjakan untuk melakukan layanan atas nama kami, seperti layanan hosting web. Pihak ketiga tersebut juga memiliki kewajiban untuk menjaga keamanan dan kerahasiaan Data Pribadi dan untuk memproses Data Pribadi hanya sesuai dengan instruksi kami.</span></li><li style=\"font-size: 15px; line-height: 30px; color: rgb(110, 109, 109);\"><span style=\"font-family: Arial;\">Stori mungkin menyingkapkan Data Pribadi untuk melindungi diri kami terhadap tuntutan, untuk menanggapi panggilan menjadi saksi, proses peradilan, permohonan yang sah dari petugas penegak hukum, atau sebagaimana yang diperlukan untuk mematuhi hukum negara dan undang-undang yang berlaku. Kami juga mungkin menyingkapkan Data Pribadi untuk menegakkan atau mengaplikasikan syarat dan ketentuan yang berlaku bagi produk dan layanan kami, atau untuk melindungi hak, properti atau keselamatan Stori, pengguna kami, atau lainnya.</span></li></ul><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Tindakan Hukum</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Meskipun kami berusaha maksimal untuk menjaga privasi pengguna, kami juga perlu memberikan informasi pribadi jika diperlukan oleh hukum dimana kami yakin bahwa tindakan seperti ini perlu dilakukan untuk memenuhi current judicial process (proses pengadilan), ketetapan pengadilan atau proses hukum yang berlaku di Stori.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kami memberikan informasi demografi keseluruhan kepada mitra dan pengiklan kami. Sebagai contoh, kami dapat secara berkala memberikan informasi seperti jumlah pengunjung, area ketertarikan, hubungan dengan Stori, dll. Ini tidak ada kaitannya dengan informasi yang secara personal tidak dapat teridentifikasi.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Jika ada yang menggunakan nama stori.id untuk tujuan mengambil keuntungan sendiri diluar apa yang Stori jual secara resmi maka akan dilakukan tindakan hukum sebagaimana tindak pencurian dan atau perusakan nama baik. stori.id tidak akan segan-segan untuk mengadukan pihak(-pihak) tak bertanggung jawab tersebut kepada Polisi untuk diproses keputusan hukumnya sesuai yang berlaku di Negara Republik Indonesia!</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Jika ada yang menemukan orang yang menjual dan atau menggunakan nama stori.id secara sepihak tanpa persetujuan resmi dari stori.id, Abda bisa melaporkan langsung kepada kami lewat</span>&nbsp;<a href=\"mailto:info@stori.id\" style=\"text-decoration: none; -webkit-tap-highlight-color: rgba(255, 255, 255, 0); outline: 0px; color: rgb(206, 10, 70);\">info@stori.id</a></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Tautan</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Website ini dapat memiliki tautan ke situs lain. Perlu Anda ketahui bahwa kami, Stori, tidak bertanggungjawab atas konten atau praktek privasi situs lainnya. Kami membedakan situs-situs web pihak ketiga ini dengan metode seperti membukanya pada jendela browser terpisah atau dalam suatu bingkai yang mengindikasikan area yang bukan bagian dari situs kami. Dalam hal ini, kebijakan privasi website Stori tidak berlaku. Kami harap pengguna berhati-hati ketika meninggalkan situs kami dan membaca pernyataan privasi masing-masing dan setiap Website yang Anda kunjungi. Pernyataan privasi berlaku sepenuhnya terhadap informasi yang diperoleh website ini.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Pemberitahuan Perubahan</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Jika kami memutuskan untuk mengubah kebijakan privasi kami, kami akan mengirim perubahan tersebut pada pernyataan privasi ini, yang dapat diakses dari halaman utama</span>&nbsp;<a href=\"https://stori.id/\" style=\"text-decoration: none; -webkit-tap-highlight-color: rgba(255, 255, 255, 0); outline: 0px; color: rgb(206, 10, 70);\">https://stori.id</a>, <span style=\"font-family: Arial;\">atau tempat lain yang kami anggap tepat.</span></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Kami akan berusaha semaksimal mungkin untuk menggunakan informasi sesuai dengan kebijakan privasi dimana informasi diperoleh. Terkadang, kami juga mengirim email kepada pengguna yang telah memilih menerima komunikasi dari kami, yang memberitahukan mereka mengenai perubahan privasi kami. Meskipun demikian, jika pengguna telah meng-opt-out semua komunikasi dengan situs, atau menghapus/menonaktifkan akun mereka, maka mereka tidak akan dihubungi lagi.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Pemberitahuan Perubahan</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Dengan menggunakan website kami, dengan ini Anda setuju pada pengumpulan dan pemakaian informasi ini sebagaimana ditetapkan dalam kebijakan privasi ini.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Gambaran Umum</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Tidak ada sesuatu apapun dalam perjanjian ini yang merupakan usaha kami untuk menjaga kerahasiaan informasi apapun yang diberikan kepada kami dalam hal pemakaian Website kami.</span></p><h3 class=\"color black\" style=\"color: rgb(51, 51, 51); font-size: 20px; line-height: 30px; margin-top: 0px !important; margin-bottom: 0px !important; font-family: Museo, sans-serif !important;\">Informasi Kontak</h3><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">Jika pengguna memiliki pertanyaan atau saran yang berkaitan dengan kebijakan privasi, silahkan kirimkan email ke</span>&nbsp;<a href=\"mailto:info@stori.id\" style=\"text-decoration: none; -webkit-tap-highlight-color: rgba(255, 255, 255, 0); outline: 0px; color: rgb(206, 10, 70);\">info@stori.id</a>.</p>\r\n\r\n</div>', 'Kebijakan Stori', 1173, 1, 1, 0, 1, '2020-01-13 09:48:39', NULL, '2020-02-14 02:14:14');
INSERT INTO `pages` (`id`, `page_title`, `page_slug`, `page_summary`, `page_body`, `page_keywords`, `page_views`, `page_visible`, `page_in_menu`, `page_in_footer`, `page_author_id`, `page_created_at`, `page_deleted_at`, `page_updated_at`) VALUES
(3, 'Syarat & Ketentuan', 'ketentuan', 'Ketentuan', '<div class=\"ui very padded segment\">\r\n\r\n<p>KETENTUAN DAN SYARAT PENERBITAN ARTIKEL INI (\"KETENTUAN DAN SYARAT\") BERLAKU DAN MENGIKAT SEBAGAI PERJANJIAN ANTARA [PT Stori PRODUCTION] (\"PENERBIT\") DENGAN KONTRIBUTOR YANG MENGGUNAKAN LAYANAN PENERBITAN MILIK PENERBIT. BAGI KONTRIBUTOR YANG BERUSIA DI BAWAH 21 TAHUN WAJIB DIDAMPINGI OLEH WALI DAN/ATAU ORANG TUA KONTRIBUTOR PADA SAAT MEMBACA KETENTUAN DAN SYARAT INI.</p><p>KONTRIBUTOR (BERSAMA ORANG TUA DAN/ATAU WALINYA, APABILA DIPERLUKAN) WAJIB MEMBACA DAN SEPENUHNYA MENGERTI SELURUH ISI DARI KETENTUAN DAN SYARAT INI SEBELUM MULAI MENGGUNAKAN LAYANAN PENERBITAN [PT Stori PRODUCTION]. APABILA KONTRIBUTOR TELAH MEMBERI TANDA PERSETUJUAN DI BAWAH KETENTUAN DAN SYARAT INI DAN/ATAU MENERBITKAN ARTIKEL MELALUI LAYANAN [PT Stori PRODUCTION], BERARTI KONTRIBUTOR TELAH MENGERTI ISI DARI KETENTUAN DAN SYARAT INI DAN SETUJU UNTUK TUNDUK DAN TERIKAT PADA KETENTUAN DAN SYARAT INI.</p><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">A.DEFINISI</h2><p style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin-bottom: 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\">Kecuali ditentukan lain, dalam Ketentuan dan Syarat ini yang dimaksud dengan:</p><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor adalah pihak yang memberikan kontribusi berupa Ciptaan, baik dalam kedudukannya sebagai pemilik Hak Cipta dan/atau pihak yang menerima hak tersebut secara sah dari Pencipta, dan/atau pihak lain yang menerima lebih lanjut hak dari pihak yang menerima Hak Cipta tersebut secara sah sehingga sah dan berwenang memberikan lisensi kepada Penerbit.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit adalah [PT Stori Production], yang menyediakan Layanan dan menerima kontribusi berupa Ciptaan dari Kontributor.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Ciptaan adalah setiap hasil karya cipta di bidang ilmu pengetahuan, seni, dan sastra yang dihasilkan atas inspirasi, kemampuan, pikiran, imajinasi, kecekatan, keterampilan, atau keahlian yang diekspresikan dalam bentuk nyata.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Hak Cipta adalah hak eksklusif Pencipta yang timbul secara otomatis berdasarkan prinsip deklaratif setelah suatu Ciptaan diwujudkan dalam bentuk nyata tanpa mengurangi pembatasan sesuai dengan ketentuan peraturan perundangan.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pencipta adalah seorang atau beberapa orang yang secara sendiri-sendiri atau bersama-sama menghasilkan suatu Ciptaan yang bersifat khas dan pribadi.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Program Komputer adalah seperangkat instruksi yang diekspresikan dalam bentuk bahasa, kode, skema, atau dalam bentuk apapun yang ditujukan agar komputer bekerja melakukan fungsi tertentu atau untuk mencapai hasil tertentu.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Program Terafiliasi adalah Program Komputer milik pihak lain yang mengakses Program Komputer milik Penerbit</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Potret adalah karya fotografi dengan objek manusia.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pengumuman adalah pembacaan, penyiaran, pameran, suatu Ciptaan dengan menggunakan alat apapun baik elektronik atau non elektronik atau melakukan dengan cara apapun sehingga suatu Ciptaan dapat dibaca, didengar, atau dilihat orang lain.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penggandaan adalah proses, perbuatan, atau cara menggandakan satu salinan Ciptaan dan/atau fonogram atau lebih dengan cara dan dalam bentuk apapun, secara permanen atau sementara.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penyiaran adalah pentransmisian suatu Ciptaan atau produk Hak Terkait tanpa kabel sehingga dapat diterima oleh semua orang di lokasi yang jauh dari tempat transmisi berasal.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Komunikasi kepada publik yang selanjutnya disebut Komunikasi adalah pentransmisian suatu Ciptaan, pertunjukan, atau fonogram melalui kabel atau media lainnya selain Penyiaran sehingga dapat diterima oleh publik, termasuk penyediaan suatu Ciptaan, pertunjukan, atau fonogram agar dapat diakses publik dari tempat dan waktu yang dipilihnya.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Royalti adalah imbalan atas pemanfaatan hak ekonomi suatu Ciptaan atau Produk Hak Terkait yang diterima oleh Pencipta atau pemilik Hak Terkait.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penggunaan Secara Komersial adalah pemanfaatan Ciptaan dan/atau produk Hak Terkait dengan tujuan untuk memperoleh keuntungan ekonomi dari berbagai sumber atau berbayar.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Hari adalah hari kalender.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Layanan adalah jasa yang disediakan oleh Penerbit untuk Pengumuman dan/atau Penggandaan atas Ciptaan yang diterima dari Kontributor melalui Program Komputer, baik milik sendiri maupun melalui Program Terafiliasi, atau dengan cara lain.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Konten adalah kumpulan Ciptaan yang diterima oleh Penerbit dari Kontributor, baik yang telah melalui Pengumuman dan/atau Penggandaan maupun belum.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Hak Jawab adalah hak seseorang atau sekelompok orang untuk memberikan tanggapan atau sanggahan terhadap pemberitaan berupa fakta yang merugikan nama baiknya.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Hak Koreksi adalah hak setiap orang untuk mengoreksi atau membetulkan kekeliruan informasi yang diberitakan oleh pers, baik tentang dirinya maupun tentang orang lain.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kewajiban Koreksi adalah keharusan melakukan koreksi atau ralat terhadap suatu informasi, data, fakta, opini, atau gambar yang tidak benar yang telah diberitakan oleh pers yang bersangkutan.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Akun adalah akun keanggotaan Kontributor untuk dapat menggunakan Layanan.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Ketentuan dan Syarat adalah Ketentuan dan Syarat Penerbitan Artikel oleh [PT Stori Production] termasuk setiap penambahan dan/atau perubahan yang telah berlaku efektif atau akan berlaku efektif di kemudian hari.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">B.PERSYARATAN UMUM</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor wajib tunduk dan melaksanakan Ketentuan dan Syarat ini selama Kontributor masih memiliki Akun dan/atau menggunakan Layanan.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Ketentuan tentang Jaminan Kontributor, Pemanfaatan Konten Oleh Penerbit, Kerahasiaan, Pilihan Hukum dan Penyelesaian Sengketa, dan Pemberitahuan masih tetap berlaku dan mengikat Kontributor walaupun Akun telah dihentikan sementara atau dihapus, Kontributor tidak lagi menggunakan Layanan, dan/atau Ciptaan tidak lagi termasuk dalam Konten.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">C.AKUN ANGGOTA</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Setiap Kontributor wajib melakukan registrasi keanggotaan dengan membuat Akun untuk menggunakan Layanan dan memberikan kontribusi Ciptaan kepada Penerbit melalui Akun tersebut.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor wajib memberikan informasi akurat, sesuai dengan data sebenarnya, dan termutakhir untuk pembuatan Akun. Kontributor wajib melakukan pemutakhiran data apabila terdapat perubahan data atas Kontributor.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit berhak (tetapi tidak wajib) untuk melakukan verifikasi data/ informasi yang diberikan oleh Kontributor.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor bertanggung jawab penuh atas Akun miliknya, termasuk tetapi tidak terbatas pada akses dan akibat penggunaan Akun tersebut.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">D.PERSYARATAN UNTUK KONTRIBUSI CIPTAAN</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Tanpa mengesampingkan pemenuhan ketentuan lain dalam penggunaan Layanan, Kontributor dengan ini menjamin dan memastikan bahwa setiap Ciptaan diserahkan kepada Penerbit TIDAK bermuatan, antara lain: (i) materi yang mengandung unsur plagiarisme atau melanggar hak pihak lain manapun; (ii) materi yang memuat isi bohong, fitnah, sadis, cabul; (iii) materi untuk memuaskan hasrat seksual; (iv) materi yang membahayakan anak-anak; (v) materi yang mengandung prasangka dan kebencian terkait dengan Suku, Agama, Ras, dan Antar golongan (SARA), serta menganjurkan kekerasan dan/atau kegiatan berbahaya; (vi) materi yang mengandung ancaman, gangguan, penghinaan, dan/atau pelecehan; (vii) materi yang dapat memicu kebencian; (viii) materi yang memuat isi diskriminatif atas perbedaan jenis kelamin dan bahasa, serta merendahkan martabat orang lemah, miskin, sakit, cacat jiwa, atau cacat jasmani; (ix) hal-hal yang bersifat sensitif; (x) materi yang mempromosikan kegiatan yang melanggar hukum.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor dengan ini menjamin dan memastikan bahwa setiap Ciptaan yang diserahkankan kepada Penerbit tidak mengandung unsur-unsur berbahaya yang dapat menimbulkan kerugian dan/atau kerusakan bagi pihak lain, termasuk tetapi tidak terbatas pada virus, spam, penyusupan jaringan, pencurian data kartu kredit, dan fitur tersembunyi lainnya.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor dengan ini menjamin dan memastikan bahwa Ciptaan tidak terafiliasi dengan pihak tertentu yang menyebabkan pembatasan dan/atau larangan untuk pemanfaatan Ciptaan sebagai Konten, dalam Layanan, dan/atau pemanfaatan komersial oleh Penerbit.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor wajib melaksanakan Kewajiban Koreksi atas Ciptaan dalam hal terdapat kesalahan dalam Ciptaan, termasuk pula apabila diminta oleh Penerbit dalam rangka melayani Hak Jawab dan/atau Hak Koreksi. Kewajiban Koreksi harus dilakukan melalui Program Komputer dan mekanisme yang ditentukan Penerbit.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit memiliki hak penuh untuk menghapus Konten yang tidak sesuai dengan atau melanggar Ketentuan dan Syarat ini.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">E.JAMINAN KONTRIBUTOR</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor menjamin Penerbit bahwa ia adalah pihak yang berwenang penuh atas Ciptaan dan berhak atas Hak Cipta termasuk namun tidak terbatas Potret dalam Ciptaan tersebut, sehingga Kontributor berhak dan berwenang penuh untuk memberikan kontribusi berupa Ciptaan kepada Penerbit.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor menjamin Penerbit bahwa Kontributor berhak untuk memberikan lisensi atas Ciptaan kepada Penerbit untuk digunakan dalam Layanan, dan akan senantiasa mempertahankan keberlakuan lisensi tersebut.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor menjamin Penerbit bahwa Ciptaan dan Hak Cipta yang terkandung di dalamnya dihasilkan atau diperoleh Kontributor secara sah dan telah memenuhi setiap syarat dan ketentuan sesuai dengan hukum dan peraturan yang berlaku.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor menjamin Penerbit bahwa Ciptaan tidak bertentangan dengan Pancasila, Undang-Undang Dasar 1945 dan peraturan perundangan yang berlaku di Republik Indonesia, memenuhi ketentuan yang terkait dengan Kode Etik Jurnalistik, serta tidak memuat hal-hal yang dapat berpotensi konflik termasuk tetapi tidak terbatas pada fitnah, penistaan, penghinaan baik yang dapat mencemarkan nama maupun bertentangan dengan kaidah kebiasaan yang berlaku pada masyarakat termasuk agama dan nilai-nilai budaya yang berlaku.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor menjamin bahwa Penerbit tidak akan mendapat tuntutan, gugatan, dan/atau permintaan ganti rugi dari pihak lain terkait dengan kepemilikan atas Ciptaan dan/atau Hak Cipta dan pemanfaatan Ciptaan dan/atau Hak Cipta oleh Penerbit berdasarkan Ketentuan dan Syarat ini, dan Kontributor dengan ini berjanji untuk membebaskan Penerbit dari setiap tuntutan, gugatan, dan/atau permintaan ganti rugi tersebut.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor menjamin bahwa pihaknya melakukan verifikasi atas setiap Ciptaan yang dikontribusikan, terutama untuk berita yang dapat merugikan pihak lain, untuk memenuhi prinsip akurasi dan keberimbangan.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">F.PEMANFAATAN KONTEN OLEH PENERBIT</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit sepenuhnya berhak untuk memanfaatkan Konten untuk Layanan, termasuk memanfaatkan Konten untuk kepentingan komersial. Penerbit dapat memperoleh pendapatan dari pemanfaatan komersial atas Konten.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Ciptaan yang dapat dimanfaatkan untuk kepentingan komersial adalah Ciptaan yang banyak dilihat, dibaca, dan/atau disukai oleh publik, yang akan ditentukan berdasarkan pertimbangan Penerbit sendiri.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Sepanjang tidak mengubah substansi Ciptaan, Penerbit berhak untuk: (i) mengubah judul Ciptaan; (ii) menerjemahkan Ciptaan; (iii) melakukan adaptasi atas Ciptaan; (iv) membuat ringkasan atas Ciptaan; (v) menyusun dan mereka ulang bentuk Ciptaan, disesuaikan dengan media Penerbit.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Dalam hal ada batasan dan/atau larangan untuk pemanfaatan Ciptaan oleh Penerbit (antara lain karena adanya afiliasi Kontributor dengan pihak tertentu), maka batasan dan/atau larangan tersebut wajib diberitahukan terlebih dahulu kepada Penerbit untuk dievaluasi lebih lanjut dari Penerbit.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit tidak menjamin bahwa untuk setiap Ciptaan akan digunakan dalam Konten, Layanan, dan/atau dimanfaatkan untuk kepentingan komersial. Penebit memiliki hak penuh untuk menentukan Ciptaan yang layak atau tidak layak untuk Konten, Layanan dan/atau dimanfaatkan untuk kepentingan Komersial.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit berhak untuk menarik kembali suatu Ciptaan dari Layanan dan/atau tidak lagi menggunakan Ciptaan untuk Konten atau kepentingan komersial, seluruhnya atas pertimbangan Penerbit sendiri.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">G.PAJAK</h2><p style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin-bottom: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\">Setiap kewajiban perpajakan yang timbul dari pelaksanaan Ketentuan dan Syarat ini menjadi beban dan tanggung jawab masing-masing pihak sesuai dengan ketentuan perpajakan yang berlaku.</p><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">H.PENGGUNAAN AKUN DAN LAYANAN</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor wajib menjaga kerahasiaan atas setiap kunci untuk mengakses Akun miliknya, dan dengan ini menegaskan bahwa pihaknya bertanggung jawab penuh atas setiap penggunaan dan aktivitas dari Akun miliknya.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor bertanggung jawab penuh atas setiap penggunaan Layanan oleh Kontributor, dan Kontributor dengan ini setuju untuk membebaskan Penerbit (termasuk seluruh karyawan, pemasok, pengurus, dan perwakilan Penerbit) dari setiap tuntutan, gugatan, dan/atau permintaan ganti rugi yang timbul karenanya.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor tidak diperkenankan untuk menggunakan Akun dan/atau Layanan tidak sesuai dengan Ketentuan dan Syarat ini, melanggar peraturan dan hukum yang berlaku, dan/atau melakukan perubahan dan/atau tindakan lain yang dapat menyebabkan perubahan sistem dan mekanisme Program Komputer.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit tidak bertanggung jawab atas penyalahgunaan Akun dan/atau penggunaan Layanan oleh Kontributor yang tidak sesuai dengan mekanisme dan Program Komputer yang ditentukan Penerbit.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">I.PENGHENTIAN SEMENTARA DAN PENGHAPUSAN AKUN</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit berhak untuk menghentikan sementara Akun, antara lain apabila: (i) diketahui bahwa Ciptaan tidak memenuhi satu atau lebih ketentuan dalam Ketentuan dan Syarat ini; (ii) diketahui bahwa Kontributor melanggar satu atau lebih ketentuan dalam Ketentuan dan Syarat ini; (iii) Kontributor belum/tidak menyetujui penambahan dan/atau perubahan atas Ketentuan dan Syarat ini; (iv) diduga oleh Penerbit adanya aktivitas mencurigakan dari Akun; (v) adanya penyalahgunaan Akun; (vi) tidak adanya aktivitas dari Akun selama 30 (tiga puluh) hari berturut-turut.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit berhak untuk menghapus Akun, antara lain apabila: (i) penghentian sementara Akun telah berlangsung 14 (empat belas) hari berturut-turut dan tidak ada tanggapan Kontributor untuk pengakhiran penghentian sementara; (ii) Kontributor mengulangi pelanggaran atas ketentuan dalam Ketentuan dan Syarat ini setelah diperingatkan oleh Penerbit; (iii) terdapat Ciptaan dari Akun yang tidak memenuhi ketentuan dalam Ketentuan dan Syarat ini dan/atau tidak dilakukan Kewajiban Koreksi sesuai Ketentuan dan Syarat ini setelah diperingatkan oleh Penerbit.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">J.PENGALIHAN</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor tidak diperkenankan untuk mengalihkan sebagian atau seluruh hak, kewajiban, dan tanggung jawabnya berdasarkan Ketentuan dan Syarat ini kepada pihak lain manapun.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit dapat mengalihkan hak, kewajiban, dan tanggung jawabnya berdasarkan Ketentuan dan Syarat ini kepada pihak lain yang ditunjuk Penerbit, dengan pemberitahuan kepada Kontributor. Pihak yang menerima pengalihan tersebut akan melanjutkan pelaksanaan Ketentuan dan Syarat ini dengan Kontributor.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">K.KERAHASIAAN</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Kontributor dengan ini menegaskan bahwa tidak ada kewajiban bagi Penerbit untuk menjaga kerahasiaan setiap dan seluruh bagian dari Ciptaan dan/atau Konten.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pemanfaatan Ciptaan secara komersial oleh Penerbit dan penerimaan manfaat komersial oleh Kontributor bersifat rahasia antara Penerbit dan Kontributor. Penerbit dan Kontributor sepakat untuk memperlakukan setiap informasi terkait dengan hal tersebut secara rahasia, oleh karenanya tidak ada informasi apapun yang terkait dengan hal tersebut akan diberitahukan kepada siapa pun selain di antara para pihak, kecuali: (i) informasi yang harus diungkapkan dalam rangka pelaksanaan Ketentuan dan Syarat ini; (ii) informasi yang sudah menjadi milik umum; (iii) informasi yang diminta dibuka atas perintah pengadilan atau pejabat yang berwenang.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Tidak ada ketentuan dalam Ketentuan dan Syarat ini yang menghapus kewajiban kerahasiaan ini dan ketentuan kerahasiaan ini tetap berlaku walaupun jangka waktu Ketentuan dan Syarat ini telah berakhir.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">L.KEADAAN KAHAR</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Tidak terlaksananya atau tertundanya baik sebagian maupun keseluruhan pelaksanaan ketentuan dalam Ketentuan dan Syarat ini oleh satu pihak atau para pihak tidak termasuk sebagai kelalaian apabila hal tersebut disebabkan oleh adanya keadaan kahar.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Termasuk sebagai keadaan kahar adalah kejadian-kejadian yang dengan segala daya dan upaya tidak dapat diduga dan tidak dapat diatasi oleh pihak yang mengalaminya, yakni peristiwa-peristiwa sebagai berikut: (i) bencana alam; (ii) pemberontakan, huru-hara, perang; (iii) kebakaran; (iv) sabotase; (v) pemogokan massal; (vi) peraturan atau keputusan Pemerintah dalam bidang politik, moneter dan perundang-undangan yang berdampak langsung terhadap kegiatan usaha para pihak.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Pihak yang tidak dapat memenuhi kewajibannya sehubungan dengan keadaan kahar tersebut harus memberitahukan secara tertulis kepada pihak yang lain dalam waktu paling lambat 5 (lima) Hari sejak peristiwa tersebut terjadi. Kelalaian atau kelambatan pemberitahuan dari pihak yang terkena keadaan kahar dapat mengakibatkan tidak diakuinya peristiwa dimaksud sebagai keadaan kahar.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Seluruh kerugian dan biaya yang diderita oleh salah satu pihak sebagai akibat keadaan memaksa tidak menjadi tanggung jawab pihak yang lain.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">M.PILIHAN HUKUM DAN PENYELESAIAN SENGKETA</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Ketentuan dan Syarat ini tunduk, diatur dan dilaksanakan menurut hukum Negara Republik Indonesia.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Segala perselisihan yang mungkin timbul dalam menjalankan Ketentuan dan Syarat ini, akan diupayakan penyelesaiannya secara musyawarah oleh para pihak.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Apabila penyelesaian secara musyawarah tidak tercapai, atau salah satu pihak tidak bersedia untuk musyawarah, maka para pihak setuju dan sepakat untuk menyerahkan penyelesaian sengketa yang timbul melalui Pengadilan Negeri Jakarta Pusat di Jakarta.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">N.PEMBERITAHUAN</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Semua pemberitahuan dan/atau korespondensi yang perlu disampaikan kepada Kontributor akan disampaikan melalui alamat yang disampaikan Kontributor dalam Akun. Jika terdapat perubahan alamat, maka Kontributor wajib memberitahukan perubahan tersebut secara tertulis kepada Penerbit selambat-lambatnya 2 (dua) Hari sebelum tanggal efektif perubahan alamat tersebut.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Setiap pemberitahuan dan/atau korespondensi yang perlu disampaikan kepada Penerbit wajib disampaikan melalui PT Stori PRODUCTION.</li></ol><h2 style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 36px; font-weight: inherit; margin-top: 30px; margin-bottom: 20px; outline: 0px; vertical-align: baseline; line-height: 1.1; color: rgb(31, 31, 31);\">O.LAIN-LAIN</h2><ol style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: Calibri; font-size: 16px; margin: 0px 0px 25px 20px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(31, 31, 31);\"><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Dalam hal ada perubahan atas ketentuan dalam Ketentuan dan Syarat ini, maka perubahan tersebut akan diberitahukan secara tertulis kepada Kontributor dari waktu ke waktu. Apabila Kontributor tidak memberikan persetujuan atas perubahan tersebut dalam waktu selambat-lambatnya 5 (lima) Hari setelah diberitahukan, maka Kontributor dianggap telah menyetujui perubahan tersebut. Setiap perubahan menjadi satu kesatuan yang tidak terpisahkan dari Ketentuan dan Syarat ini.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Penerbit tidak akan memberikan kompensasi dan/atau ganti rugi apapun atas penghentian sementara atau penghapusan Akun sesuai dengan ketentuan dalam Ketentuan dan Syarat ini, dan untuk itu para pihak telah sepakat untuk mengesampingkan ketentuan Pasal 1266 paragraf (2), (3), dan (4) Kitab Undang-Undang Hukum Perdata Republik Indonesia.</li><li style=\"-webkit-tap-highlight-color: transparent; border: 0px; font-family: inherit; font-style: inherit; font-weight: inherit; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline;\">Apabila ada ketentuan dalam Ketentuan dan Syarat ini yang dinyatakan tidak dapat ditegakkan atau tidak berlaku, ketentuan tersebut dapat diubah untuk membuatnya dapat ditegakkan dan berlaku. Apabila perubahan tidak dapat dilakukan, ketentuan tersebut akan dianggap dihapuskan, namun demikian ketentuan selebihnya dalam Ketentuan dan Syarat ini akan tetap berlaku sepenuhnya.</li></ol>\r\n\r\n</div>', 'Ketentuan Stori', 845, 1, 1, 0, 1, '2020-01-13 09:53:01', NULL, '0000-00-00 00:00:00'),
(4, 'Bantuan (FAQ)', 'bantuan', 'FAQ Stori, Frequently Asked Questions', '<div class=\"ui very padded segment\">\r\n\r\n<p><b>Apa yang dimaksud dengan Independent Contributor (Stori)?</b></p><p>Stori adalah orang yang mengambil posisi sebagai penulis lepas di aplikasi Stori. Sebagai penulis lepas, kompensasi yang akan didapatkan bukan berupa gaji, melainkan menggunakan sistem bagi hasil.</p><p><b>Bagaimana menjadi kontributor di Stori?</b></p><p>Setiap orang mendapatkan kesempatan untuk menjadi kontributor di Stori, sepanjang mampu menghasilkan karya yang berkualitas dan sesuai dengan tata aturan yang diterapkan oleh Stori.</p><ol><li>Langkah pertamaa, kamu harus melakukan registrasi. Kamu harus mengisi formulir pendaftaran, lalu menyetujui kesepakatan dan tata aturan tentang aplikasi Stori dengan benar. Dalam hal data yang dimasukkan tidak sesuai dengan yang sebenarnya, resiko tidak menerima bayaran harus ditanggung oleh pendaftar.</li><li>Ada baiknya pula jika kamu mempersiapkan kartu identitas, seperti KTP (ID CARD), dan Rekening Bank.</li><li>Sebelum melakukan registrasi, disarankan sudah membaca ketentuan, memahami dan mematuhi setiap ketentuan yang ada.</li></ol><p><b>Mengapa harus memilih Stori sebagai platform mitra terbaik bagi penulis?</b></p><ol><li>Stori memberikan bagi hasil.</li><li>Tidak ada masa kadaluarsa untuk artikelmu. Ini berarti ada banyak kesempatan bagimu untuk mendapatkan lebih banyak pendapatan.</li><li>Stori memberikan kebebasan untuk memilih jenis topik yang kamu sukai, seperti hiburan, bisnis, gaya hidup, olahraga, hobi, dan lain-lain.</li><li>Stori akan meningkatkan pengalaman kamu dalam menulis. Kami percaya keterampilan tidak datang secara otomatis. Dibutuhkan proses untuk menghasilkan tulisan yang berkualitas. Kami akan memberikan beberapa ajang yang dapat diikuti para penulis lepas untuk memberdayakan keterampilan mereka. Kami bangga menjadi bagian dari pengalaman menulis kamu.</li><li>Stori menghargai setiap ide dan pengalamanmu. Kami akan membuat kamu sebagai bintang penulis lepas yang sukses bersama kami.</li></ol><p><b>Konten atau artikel apa yang disarankan dikirimkan?</b></p><p>Agar bisa medapat respon yang baik dari pembaca, disarankan untuk menulis dengan topik yang menyangkut kehidupan sehari-hari. Misalnya tips-tips, atau segala hal yang mempunyai manfaat langsung bagi para pembaca.</p><p><b>Konten atau artikel apa yang dilarang ditampilkan di Stori?</b></p><p>Stori memiliki hak untuk menolak setiap tulisan yang mengandung plagiarisme, pornografi, isu rasial, kebencian agama, atau hal lain yang mengandung pelanggaran hukum dan kode etik.</p><p><b>Bagaimana saya bisa mendapatkan uang dari Stori? Dan berapa banyak?</b></p><ol><li>Kamu akan mendapatkan uang melalui iklan yang tertanam pada artikelmu.</li><li>Stori akan membayar bagi hasil kepadamu berdasarkan klik iklan yang disertakan di artikelmu.</li><li>Mengacu pada Peraturan Pajak di Indonesia, jumlah nominal yang akan kami transfer ke kamu adalah pendapatan setelah pajak. Kami menyarankan kamu untuk mengiformasikan NPWP kamu untuk menghindari membayar pajak yang lebih tinggi. Kami menginformasikan bahwa bagi yang memiliki NPWP akan dikenakan biaya 2,5% dan jika tidak memiliki NPWP kami akan mengenakan biaya 3% (20% lebih tinggi dari normal).</li><li>Khusus untuk penulis lepas asing, risiko nilai tukar luar negeri menjadi tanggungan sang penulis.</li></ol><p><b>Bagaimana pembayaran saya akan dilakukan?</b></p><ol><li>Kami akan melakukan pembayaran melalui transfer bank.</li><li>Pembayaran yang akan kami proses berdasarkan ambang batas pembayaran.</li><li>Batas minimum pembayaran untuk Sahabat Nulis adalah Rp. 200.000 per bulan. Apabila tidak memenuhi batas tersebut, pembayaran akan dilakukan di bulan berikutnya.</li></ol><p><b>Bagaimana cara memeriksa jumlah pendapatan saya?</b></p><p>Silakan pergi ke situs dan masuk menggunakan identitas pengguna yang telah terdaftar.</p>\r\n\r\n</div>', 'Faq Stori, Frequently Asked Questions', 711, 1, 1, 0, 1, '2020-01-13 09:57:22', NULL, '2020-02-28 00:02:28'),
(6, 'Room Kreator', 'room-kreator', 'Room Chat Kreator, Room Chat', '<div class=\"ui very padded segment\">\r\n\r\n<div style=\"width:100%; height:100%;\"><iframe style=\"width:100%; height:500px; border:none;\" src=\"https://stori.id/room/\"></iframe></div></div>', 'Room Chat, Obrolan Chat, Kontributor, Kreator, Room Kreator', 2866, 1, 0, 1, 1, '2020-01-15 12:07:38', NULL, '0000-00-00 00:00:00');
