(8, 'Media Siber', 'pedoman-media-siber', 'Pedoman Media Siber Stori', '<div class=\"ui very padded segment\">\r\n\r\n<p>Kemerdekaan berpendapat, kemerdekaan berekspresi, dan kemerdekaan pers adalah hak asasi manusia yang dilindungi Pancasila, Undang-Undang Dasar 1945, dan Deklarasi Universal Hak Asasi Manusia PBB. Keberadaan media siber di Indonesia juga merupakan bagian dari kemerdekaan berpendapat, kemerdekaan berekspresi, dan kemerdekaan pers. Media siber memiliki karakter khusus sehingga memerlukan pedoman agar pengelolaannya dapat dilaksanakan secara profesional, memenuhi fungsi, hak, dan kewajibannya sesuai Undang-Undang Nomor 40 Tahun 1999 tentang Pers dan Kode Etik Jurnalistik. Untuk itu Dewan Pers bersama organisasi pers, pengelola media siber, dan masyarakat menyusun Pedoman Pemberitaan Media Siber sebagai berikut:</p><p></p><h3><a href=\"https://stori.id/cyber-media#collapse1-ruang-lingkup\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">1. Ruang Lingkup</a></h3><ol><li>Media Siber adalah segala bentuk media yang menggunakan wahana internet dan melaksanakan kegiatan jurnalistik, serta memenuhi persyaratan Undang-Undang Pers dan Standar Perusahaan Pers yang ditetapkan Dewan Pers.</li><li>Isi Buatan Pengguna (User Generated Content) adalah segala isi yang dibuat dan atau dipublikasikan oleh pengguna media siber, antara lain, artikel, gambar, komentar, suara, video dan berbagai bentuk unggahan yang melekat pada media siber, seperti blog, forum, komentar pembaca atau pemirsa, dan bentuk lain.</li></ol><h3><a href=\"https://stori.id/cyber-media#collapse2-verifikasi-dan-keberimbangan-berita\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">2. Verifikasi dan keberimbangan berita</a></h3><p>a. Pada prinsipnya setiap berita harus melalui verifikasi.</p><p>b. Berita yang dapat merugikan pihak lain memerlukan verifikasi pada berita yang sama untuk memenuhi prinsip akurasi dan keberimbangan.</p><p>c. Ketentuan dalam butir (a) di atas dikecualikan, dengan syarat:</p><ol><li>Berita benar-benar mengandung kepentingan publik yang bersifat mendesak;</li><li>Sumber berita yang pertama adalah sumber yang jelas disebutkan identitasnya, kredibel dan kompeten;</li><li>Subyek berita yang harus dikonfirmasi tidak diketahui keberadaannya dan atau tidak dapat diwawancarai;</li><li>Media memberikan penjelasan kepada pembaca bahwa berita tersebut masih memerlukan verifikasi lebih lanjut yang diupayakan dalam waktu secepatnya. Penjelasan dimuat pada bagian akhir dari berita yang sama, di dalam kurung dan menggunakan huruf miring.</li></ol><p>d. Setelah memuat berita sesuai dengan butir (c), media wajib meneruskan upaya verifikasi, dan setelah verifikasi didapatkan, hasil verifikasi dicantumkan pada berita pemutakhiran (update) dengan tautan pada berita yang belum terverifikasi.</p><h3><a href=\"https://stori.id/cyber-media#collapse3-isi-buatan-pengguna-user-generated-content-\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">3. Isi Buatan Pengguna (User Generated Content)</a></h3><p>a. Media siber wajib mencantumkan syarat dan ketentuan mengenai Isi Buatan Pengguna yang tidak bertentangan dengan Undang-Undang No. 40 tahun 1999 tentang Pers dan Kode Etik Jurnalistik, yang ditempatkan secara terang dan jelas.¬†</p><p>b. Media siber mewajibkan setiap pengguna untuk melakukan registrasi keanggotaan dan melakukan proses log-in terlebih dahulu untuk dapat mempublikasikan semua bentuk Isi Buatan Pengguna. Ketentuan mengenai log-in akan diatur lebih lanjut.¬†</p><p>c. Dalam registrasi tersebut, media siber mewajibkan pengguna memberi persetujuan tertulis bahwa Isi Buatan Pengguna yang dipublikasikan:</p><ol><li>Tidak memuat isi bohong, fitnah, sadis dan cabul;</li><li>Tidak memuat isi yang mengandung prasangka dan kebencian terkait dengan suku, agama, ras, dan antargolongan (SARA), serta menganjurkan tindakan kekerasan;</li><li>Tidak memuat isi diskriminatif atas dasar perbedaan jenis kelamin dan bahasa, serta tidak merendahkan martabat orang lemah, miskin, sakit, cacat jiwa, atau cacat jasmani.</li></ol><p>d. Media siber memiliki kewenangan mutlak untuk mengedit atau menghapus Isi Buatan Pengguna yang bertentangan dengan butir (c).¬†</p><p>e. Media siber wajib menyediakan mekanisme pengaduan Isi Buatan Pengguna yang dinilai melanggar ketentuan pada butir (c). Mekanisme tersebut harus disediakan di tempat yang dengan mudah dapat diakses pengguna.¬†</p><p>f. Media siber wajib menyunting, menghapus, dan melakukan tindakan koreksi setiap Isi Buatan Pengguna yang dilaporkan dan melanggar ketentuan butir (c), sesegera mungkin secara proporsional selambat-lambatnya 2 x 24 jam setelah pengaduan diterima.¬†</p><p>g. Media siber yang telah memenuhi ketentuan pada butir (a), (b), (c), dan (f) tidak dibebani tanggung jawab atas masalah yang ditimbulkan akibat pemuatan isi yang melanggar ketentuan pada butir (c). h. Media siber bertanggung jawab atas Isi Buatan Pengguna yang dilaporkan bila tidak mengambil tindakan koreksi setelah batas waktu sebagaimana tersebut pada butir (f).</p><h3><a href=\"https://stori.id/cyber-media#collapse4-ralat-koreksi-dan-hak-jawab\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">4. Ralat, Koreksi, dan Hak Jawab</a></h3><p>a. Ralat, koreksi, dan hak jawab mengacu pada Undang-Undang Pers, Kode Etik Jurnalistik, dan Pedoman Hak Jawab yang ditetapkan Dewan Pers.¬†</p><p>b. Ralat, koreksi dan atau hak jawab wajib ditautkan pada berita yang diralat, dikoreksi atau yang diberi hak jawab.¬†</p><p>c. Di setiap berita ralat, koreksi, dan hak jawab wajib dicantumkan waktu pemuatan ralat, koreksi, dan atau hak jawab tersebut. d. Bila suatu berita media siber tertentu disebarluaskan media siber lain, maka:</p><ol><li>Tanggung jawab media siber pembuat berita terbatas pada berita yang dipublikasikan di media siber tersebut atau media siber yang berada di bawah otoritas teknisnya;</li><li>Koreksi berita yang dilakukan oleh sebuah media siber, juga harus dilakukan oleh media siber lain yang mengutip berita dari media siber yang dikoreksi itu;</li><li>Media yang menyebarluaskan berita dari sebuah media siber dan tidak melakukan koreksi atas berita sesuai yang dilakukan oleh media siber pemilik dan atau pembuat berita tersebut, bertanggung jawab penuh atas semua akibat hukum dari berita yang tidak dikoreksinya itu.</li></ol><p>Sesuai dengan Undang-Undang Pers, media siber yang tidak melayani hak jawab dapat dijatuhi sanksi hukum pidana denda paling banyak Rp500.000.000 (Lima ratus juta rupiah).</p><h3><a href=\"https://stori.id/cyber-media#collapse5-pencabutan-berita\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">5. Pencabutan Berita</a></h3><p>a. Berita yang sudah dipublikasikan tidak dapat dicabut karena alasan penyensoran dari pihak luar redaksi, kecuali terkait masalah SARA, kesusilaan, masa depan anak, pengalaman traumatik korban atau berdasarkan pertimbangan khusus lain yang ditetapkan Dewan Pers.¬†</p><p>b. Media siber lain wajib mengikuti pencabutan kutipan berita dari media asal yang telah dicabut.¬†</p><p>c. Pencabutan berita wajib disertai dengan alasan pencabutan dan diumumkan kepada publik.</p><h3><a href=\"https://stori.id/cyber-media#collapse6-iklan\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">6. Iklan</a></h3><p>a. Media siber wajib membedakan dengan tegas antara produk berita dan iklan.¬†</p><p>b. Setiap berita/artikel/isi yang merupakan iklan dan atau isi berbayar wajib mencantumkan keterangan \'advertorial\', \'iklan\', \'ads\', \'sponsored\', atau kata lain yang menjelaskan bahwa berita/artikel/isi tersebut adalah iklan.</p><h3><a href=\"https://stori.id/cyber-media#collapse7-hak-cipta\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">7. Hak Cipta</a></h3><p>Media siber wajib menghormati hak cipta sebagaimana diatur dalam peraturan perundang-undangan yang berlaku.</p><h3><a href=\"https://stori.id/cyber-media#collapse8-pencantuman-pedoman\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">8. Pencantuman Pedoman</a></h3><p>Media siber wajib mencantumkan Pedoman Pemberitaan Media Siber ini di medianya secara terang dan jelas.</p><h3><a href=\"https://stori.id/cyber-media#collapse9-sengketa\" target=\"_blank\" style=\"color: rgb(64, 64, 64);\">9. Sengketa</a></h3><p>Penilaian akhir atas sengketa mengenai pelaksanaan Pedoman Pemberitaan Media Siber ini diselesaikan oleh Dewan Pers.</p><p><br></p><p>Jika Anda membutuhkan bantuan yang terkait dengan penggunaan Stori, kirimkan email ke¬†<a href=\"mailto:media.stori.id@gmail.com\" target=\"_blank\" style=\"color: rgb(153, 51, 255);\">media.stori.id@gmail.com</a></p>\r\n\r\n\r\n<div class=\"ui list\">\r\n  <div class=\"item\">\r\n    <i class=\"users icon\"></i>\r\n    <div class=\"content\">\r\n      Stori Production\r\n    </div>\r\n  </div>\r\n  <div class=\"item\">\r\n    <i class=\"marker icon\"></i>\r\n    <div class=\"content\">\r\n      Jl. Tebet Timur Dalam Raya No. 65 Jakarta Selatan, Daerah Khusus Ibukota Jakarta 12820\r\n    </div>\r\n  </div>\r\n  <div class=\"item\">\r\n    <i class=\"mail icon\"></i>\r\n    <div class=\"content\">\r\n      <a href=\"mailto:admin@stori.id\">admin@stori.id</a>\r\n    </div>\r\n  </div>\r\n  <div class=\"item\">\r\n    <i class=\"linkify icon\"></i>\r\n    <div class=\"content\">\r\n      <a href=\"https://www.stori.id\">Stori.id</a>\r\n    </div>\r\n  </div>\r\n</div>\r\n\r\n</div>', 'Pedoman Media Siber, Stori', 554, 1, 0, 1, 1, '2020-02-04 18:52:56', NULL, '2020-02-24 11:54:24');
INSERT INTO `pages` (`id`, `page_title`, `page_slug`, `page_summary`, `page_body`, `page_keywords`, `page_views`, `page_visible`, `page_in_menu`, `page_in_footer`, `page_author_id`, `page_created_at`, `page_deleted_at`, `page_updated_at`) VALUES
(9, 'Panduan', 'panduan', 'Tentang Panduan Stori', '<div class=\"ui very padded segment\">\r\n\r\n\r\n<p><b>Pengertian dan Istilah-Istilah&nbsp;</b><img src=\"data:image/png;base64,\" data-filename=\"lamp.png\" style=\"font-size: 1rem; width: 23.1792px; height: 26px;;\"></p><p><b>Stori</b></p><p>Adalah aplikasi untuk berbagi informasi dengan beragam format (tulisan, foto dan video), yang seluruh kontennya berasal dari masyarakat (Citizen Journalist).</p><p><b>SAHABAT Stori</b></p><p>Adalah sebutan bagi masyarakat atau Citizen Journalist yang terdaftar dalam sistem platform Stori, memperoleh akses dan menggunakan fitur dan layanan Stori, dan mengirimkan konten ke aplikasi Stori</p><p><b>PEMBACA</b></p><p>Adalah setiap orang yang mengakses Stori, tetapi tidak bisa menempatkan konten.</p><p><b>PENGELOLA</b></p><p>Adalah pihak yang memiliki akses untuk memoderasi dan mengelola konten di aplikasi Stori. Pengelola bertugas memantau konten, mengelola tulisan yang masuk, memproses verifikasi akun, dan menjalin komunikasi dengan para SAHABAT Stori. Pengelola memiliki hak menghapus konten yang melanggar ketentuan, menyunting konten, mengatur waktu penayangan konten, melayangkan peringatan, dan memblokir akun.</p><p><b>ARTIKEL</b></p><p>Adalah tulisan karya Citizen Journalist yang berbentuk non fiksi (berita, esai, ulasan) maupun fiksi, yang dikirimkan dan dimuat di aplikasi Stori</p><p><b>KONTEN</b></p><p>Adalah materi yang ditempatkan ke dalam sistem dan/atau ditayangkan di Stori, terdiri dari tulisan, file foto dan bentuk grafik dua dimensi lainnya, video, dan audio, serta komentar. Konten juga termasuk materi yang diunduh, ditautkan atau dilekatkan ke dalam materi yang ditayangkan di Stori</p><p><b>Panduan Penulisan Artikel&nbsp;</b><img src=\"data:image/png;base64,\" data-filename=\"pencil.png\" style=\"width: 23.1792px; height: 26px;\"></p><ol><li>Judul artikel harus menggambarkan isi tulisan dan tidak menggunakan huruf kapital.</li><li>Sebuah artikel atau tulisan minimal memuat 200 kata untuk jenis non fiksi dan 100 kata untuk kategori prosa atau puisi. Jumlah kata optimal untuk tiap tulisan adalah 300-400 kata.</li><li>Agar bisa medapat respon yang baik dari pembaca, disarankan untuk menulis dengan topik yang menyangkut kehidupan sehari-hari. Misalnya tips-tips, atau segala hal yang mempunyai manfaat langsung bagi para pembaca.</li><li>Disarankan agar penulis menyertakan pula foto yang menarik sebagai pendukung tulisan. Alangkah lebih baik bila fotonya lebih dari satu.</li><li>Gaya bahasa penulisan sebaiknya menggunakan alur piramida terbalik, dengan kosakata yang mudah dipahami, sehingga tulisan lebih mengalir.</li><li>Usahakan membuat paragraf pendek, sekitar 3-4 baris saja per-paragraf dan cobalah membuat satu kesimpulan dari isi tulisan di paragraf akhir.</li></ol><p><b>Ketentuan dan Tata Aturan Pemuatan Konten&nbsp;</b><img src=\"data:image/png;base64,\" data-filename=\"content.png\" style=\"width: 23.1792px; height: 26px;\"></p><ol><li>Sahabat Nulis wajib memastikan bahwa konten tersebut tidak menimbulkan masalah terkait SARA, gender, orientasi seksual, usia, atau kecacatan fisik. Sahabat Stori juga tak diperkenankan memuat konten yang melanggar norma kesusilaan, mengandung unsur cabul dan pornografi.</li><li>Tidak diperkenankan bagi sahabat Stori untuk memuat konten yang mengancam keselamatan, memfitnah, mencemarkan nama baik, menipu, mencurangi, dan/atau menimbulkan kebencian pada individu atau kelompok tertentu.</li><li>Sahabat Stori dilarang menyebarkan ideologi atau ajaran tertentu yang melanggar hukum yang berlaku di wilayah Republik Indonesia. Juga tak diperkenankan mengajak, memaksa, orang atau kelompok untuk berafiliasi pada pribadi atau kelompok /partai politik tertentu.</li><li>Konten berisi iklan atau promosi untuk membeli produk barang atau jasa tertentu sangat dilarang untuk diposting, termasuk mengarahkan pengunjung ke sumber asli konten di luar Stori.</li><li>Sahabat Stori dilarang keras menjiplak atau menyontek atau menyalin-tempel (copy-paste) sebagian atau seluruh konten milik orang atau pihak lain tanpa maksud menciptakan konten baru sebagai karya yang orisinal. Juga tidak diperkenankan melakukan aksi plagiarisme dalam bentuk dan untuk alasan apapun.</li><li>Pemuatan konten yang mengandung virus, yang dapat mengganggu perangkat lunak (software) maupun keras (hardware), amat dilarang.</li><li>Sahabat Stori menempatkan dan menayangkan Konten dengan kesadaran sendiri dan tanpa paksaan, dan bersedia bertanggung jawab penuh atas seluruh Konten yang ditayangkan.</li></ol><p><b>Kewenangan Pengelola&nbsp;</b><img src=\"data:image/png;base64,\" data-filename=\"admin.png\" style=\"width: 23.1792px; height: 26px;\"></p><ol><li>Terkait Konten yang telah ditempatkan ke dalam sistem Stori, Pengelola/Editor berhak untuk menghapus isi konten yang melanggar Syarat dan Ketentuan dengan atau tanpa pemberitahuan kepada Sahabat Stori</li><li>Pengelola/Editor berhak menempatkan gambar sebagai ilustrasi atau pelengkap tulisan jika diperlukan. Pengelola/Editor menjamin foto yang ditempatkan tidak bertentangan dengan Syarat dan Ketentuan.</li><li>Pengelola/Editor berhak mengoreksi kekeliruan kode-kode HTML, termasuk mengoreksi penggunaan jenis huruf dan ukurannya, yang dapat mengganggu tampilan Konten secara keseluruhan.</li><li>Pengelola/Editor berhak menyunting Judul, Isi, Tag, Jenis dan Kategori konten, juga mengubah waktu tayang Konten.</li><li>Pengelola/Editor berhak untuk memblok keanggotaan Sahabat Stori yang melanggar tata aturan pemuatan konten, tanpa pemberitahuan terlebih dahulu.</li></ol>\r\n\r\n</div>', 'Panduan Kreator Stori', 610, 1, 0, 1, 1, '2020-02-07 08:45:31', NULL, '2020-02-05 23:58:06');
