(10, 'Disclaimer', 'disclaimer', 'Tentang disclaimer Stori', '<div class=\"ui very padded segment\">\r\n\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 18px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial; font-weight: bold;\">\r\n\r\nPasal Sanggahan (Disclaimer)</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nSemua informasi yang ada di dalam website ini adalah untuk tujuan dan keperluan umum saja. stori.id tidak bertanggung jawab atas kelengkapan, keandalan, dan keakuratan informasi tersebut.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nSegala tindakan yang dilakukan oleh pembaca atas informasi di situs ini, menjadi tanggungjawab dan resiko Anda sendiri. stori.id tidak bertanggung jawab atas segala kerugian dan/ atau kerusakan sehubungan dengan penggunaan informasi di website kami.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nMelalui website stori.id, Anda juga dapat mengunjungi website lain dengan mengikuti <i>hyperlink</i> ke situs eksternal tersebut. Sementara kami berusaha untuk memberikan link ke situs terpercaya, namun kami tidak punya kontrol atas isi dan sifat situs tersebut.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nPerlu diketahui juga bahwa saat Anda meninggalkan website kami dan beralih ke website lain, mungkin website tersebut juga memiliki kebijakan privasi yang berbeda dengan website Stori.id Pastikan untuk memeriksa lebih dulu ‚ÄúKebijakan Privasi‚Äù dan ‚ÄúSyarat &amp; Ketentuan‚Äù sebelum Anda mengunggah informasi atau terlibat dalam bisnis apapun dengan situs tersebut.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 18px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial; font-weight: bold;\">\r\n\r\nDMCA / Copyright Material</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nPemberitahuan Pelanggaran Hak Cipta <i>(Notification of Copyright Infringement)</i>.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nstori.id sangat menghormati hak-hak kekayaan intelektual orang lain dan kami mengharapkan Anda juga melakukan hal yang sama.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nJika Anda adalah pemilik hak cipta (gambar, video, dan lainnya), atau diberi wewenang yang bertindak atas nama perwakilan pemilik hak eksklusif / kekayaan intelektual, silakan melaporkan dugaan pelanggaran hak cipta yang terjadi.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nMengacu pada <i>Digital Millenium Copyright Act of</i> 1998,</span><span style=\"font-size: 1rem;\">&nbsp;di </span><a href=\"http://www.copyright.gov/legislation/dmca.pdf\" target=\"_blank\">copyright.gov</a><a href=\"http://www.copyright.gov/legislation/dmca.pdf\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-family: armata; font-size: 1rem; color: rgb(0, 0, 255);\"></a>&nbsp;<span style=\"font-family: Arial;\"><i>(http://www.copyright.gov/legislation/dmca.pdf)</i> kami akan merespon secepatnya untuk klaim dugaan pelanggaran hak cipta tersebut.</span></p><p></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 18px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial; font-weight: bold;\">\r\n\r\nPersetujuan</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nDengan menggunakan website stori.id, maka Anda telah setuju dengan Disclaimer dan ketentuan yang telah ditetapkan oleh situs ini.</span></p><p></p>\r\n\r\n<p></p><p style=\"margin-bottom: 20px; font-size: 15px; line-height: 31px; color: rgb(110, 109, 109); font-family: &quot;Open Sans&quot;;\"><span style=\"font-family: Arial;\">\r\n\r\nInformasi lebih lanjut atau pertanyaan tentang penyangkalan situs kami, jangan ragu untuk menghubungi melalui halaman kontak kami.</span></p><p></p>\r\n\r\n\r\n</div>', 'disclaimer', 344, 1, 0, 1, 1, '2020-03-19 19:54:46', NULL, NULL),
(11, 'Pasang Widget Covid', 'covid-19', 'Pantau tentang Covid-19 - Stori', '<div class=\"ui fluid segment\" id=\"important-covid\">\r\n<i class=\"close icon link mx-0\" onclick=\"$(this).parent().fadeOut()\"></i>\r\n\r\n<div id=\"stori-covid\"></div>\r\n<script>\r\n  var f = document.createElement(\"iframe\");\r\n  f.src = \"https://stori.id/corona\";\r\n  f.width = \"100%\";\r\n  f.height = 310;\r\n  f.scrolling = \"no\";\r\n  f.frameBorder = 0;\r\n  var rootEl = document.getElementById(\"stori-covid\");\r\n  console.log(rootEl);\r\n  rootEl.appendChild(f);\r\n</script>\r\n\r\n</div>\r\n\r\n<div class=\"ui divider fluid\"></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<center>\r\n<b onclick=\"openWin()\"> \r\n<div id=\"btn-covid\">\r\n<a href=\"https://stori.id/corona/covid.php\" class=\"btn-covid19\"  target=\"_blank\">\r\n<span class=\"circle\"><i class=\"fa fa-desktop\"></i></span>\r\n<span class=\"title\">PASANG</span>\r\n<span class=\"title-hover\">WIDGET</span>\r\n</a>\r\n</div>\r\n<script>\r\n    var myWindow;\r\n    function openWin() {\r\n      myWindow = window.open(\"https://stori.id/corona/covid.php\", \"_blank\", \"width=560, height=338\");\r\n    }\r\n</script>\r\n</center>', 'Bantu Cegah Corona, Ayo Lawan Corona, Bersama Lawan Corona, Melawan Corona, Ayo Bantu Lawan Corona, Covid 19, Covid-19, Covid, widget statistik kawal corona di wordpress, blogspot, atau website pribadi, pasang widget corona, pasang widget covid, widget corona, widget covid, Statistic widget for COVID, Statistic widget untuk COVID, statistik kawal corona, statistik corona, widget wordpress widget blog, widget blogger, widget blogspot, widget untuk blog, widget untuk wordpress, widget wp, pasang widget, pasang widget corona gratis, pantau kawal corona, pantau data corona, pantau perkembangan covid, pasang widget gratis, widget corona indonesia, widget corona virus, widget covid indonesia, widget corona wordpress, widget update corona, widget corona blogspot, widget corona blog, kawal corona, widget kawal corona, corona indonesia, pasang widget kawal corona, pasang widget corona indonesia, widget statistik corona, widget Update Statistik Virus Corona, covid-19, pantau covid 19, perkembangan covid 19', 1111, 1, 0, 1, 1, '2020-06-16 21:57:17', NULL, NULL);
